
---
apiVersion: apps/v1
kind: Deployment
metadata:
  name: flask-server
  namespace: sample-app
spec:
  replicas: 1
  selector:
    matchLabels:
      app: flask-server
  template:
    metadata:
      labels:
        app: flask-server
    spec:
      containers:
      - name: flask-server
        image: ssip-ufcg.privatedns.org/httpcarlxs/sample-app/flask-server:tls-v2-scone
        imagePullPolicy: Always
        ports:
        - containerPort: 5000
        resources:
          limits:
            sgx.k8s.io/sgx: 1
        env:
        - name: SCONE_CONFIG_ID
          value: 4mz3uc2Okw-session-k8s-scone/flask-server-cas-scone-system-flask-server/flask-server
        - name: SCONE_CAS_ADDR
          value: cas.scone-system
        - name: SCONE_VERSION
          value: '1'
        - name: SCONE_LOG
          value: FATAL
        - name: SCONE_LAS_ADDR
          valueFrom:
            fieldRef:
              apiVersion: v1
              fieldPath: status.hostIP

